import React from 'react';
import ReactDOM from 'react-dom';
import {HomePage} from './page';
import 'normalize.css';
import './style.scss';
import {Helmet} from "react-helmet";

ReactDOM.render(
    <React.StrictMode>
        <Helmet>
            <meta charset="utf-8" />
            <title>My title</title>
            <HomePage/>
        </Helmet>
    </React.StrictMode>,
    document.getElementById('root')
);
